script: |
  super -f text -I q10054.spq | sort > q10054.out

inputs:
  - name: q10054.spq
    data: |
      SELECT DISTINCT - CAST ( + col1 AS INTEGER ) FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 BETWEEN col2 AND - col2 * col1 * + col2 * col2 - - ( + 16 ) OR - + 91 < ( NULL );
  - name: tab0

outputs:
  - name: q10054.out
    data: |
